schema\u0004Note: To disable a context m:
Hinweis: Um ein Kontextmenüelement zu deaktivieren,
kopieren Sie es in die Benutzereinstellungen
und fügen Sie den Schlüssel "disabled" hinzu.
Das folgende Beispiel deaktiviert die Option "Download" für Dateien:
{
  "contextMenu": [
    {
      "command": "filebrowser:download",
      "selector": ".jp-DirListing-item[data-isdir=\"false\"]",
      "disabled": true
    }
  ]
}

